%% Barrier Tester on Turbine System! (using Sondergaard et al- 2012)
%Model based off of OpenFAST 5MW turbine

%% SIMPLEST! Version to test it out
%Ignore drive train system? Gen and torsion angle are fine anyway?
%Look at rotor speed and pitch alone?
% 3 state system maybe? - autonomous pitch?
%

clear all
close all
%echo on

%Move on to 3 state system!
%% Drive Train Sub system
%% States - 
% omega_r - Rotor angular velocity [rad/s]
% omega_g - Generator angular velocity [rad/s]
% feta_delta - Drive train torsional angle [rad]

%% Constants
J_r = 19.38e6; % Rotor inertia [kg m2]
B_r = 150e3; % Rotor friction [Nm/(rad/s)]
K_a = 15e6; % Drive train total spring constant [Nm/rad]
B_a = 12.15e6; % Drive train total torsional friction [Nm/(rad/s)]
N = 1/97; % Gear ratio
J_g = 534.12; % Generator inertia [kg m2]
B_g = 0; % Generator friction [Nm/(rad/s)] (Frictionless)

%Ignore Wind Disturbance for now! (otherwise look up in table)
rho = 1.22521;
A = 11.88e3;
R = 61.5;
v_wind = 35;
% Also ignoring tower top motion and lead lag bending for simplicity
% Values from paper are designed to resemble NREL 5-MW turbine from FAST

lambda_r = 2.025; % Max rotor velocity [rad/s]
lambda_delta = 441.42e-3; % Ultimate load limit of drive train torsion [rad]

%% MAKE SURE SOSTOOLs & SeDuMi (AND YALMIP?) ARE IN PATH

%options.solver = 'MOSEK';
options.solver='SeDuMi';

pvar x1 x2 x3 xv_wind;

x = [x1;x2;x3;xv_wind];
%Create SOS program
prog = sosprogram(x);

% Define set of monomials for input to sos poly variables - INCLUDE 0th
% Order!!!
VEC_2 = monomials(x,0:3); % So that B up to order 4! (
VEC_1 = monomials(x,0:2); % this creates Sigmas up to order 2 (from x'*Q*x)

%Define initial and unsafe spaces
% Initial state
%g_x0 = x'*Q*x;
%Either Specify operation region or optimise over it!

%[prog, g_x0] = sospolyvar(prog,monomials(x,2),'wscoeff');


%rated rotor speed is 1.25!!!
%Rated pitch = 11 at wind speed = 15 m/s
%Rated pitch = 17 at wind speed = 20 m/s
%Rated pitch = 23 at wind speed = 25 m/s
r_35 = 1.8^0.5;
r_21 = 9^0.5;
dif = r_21-r_35;
g_x0 = (x1-1.26).^2/(0.163^2) + (x2-65).^2/(5^2) + (x3+8)^2/(0.05^2) - (r_35+dif*2.5 - xv_wind*dif/14).^2; % = 1

%g_x0 = ((x1-1.25)^2/(0.3^2) + (x2-63)^2/(10^2)) + (x3+8)^2/(0.1^2) - (1.1+4.3*7/3 - xv_wind*4.3/15); % = 1


%g_x0_15 = ((x1-1.38)^2/(0.6^2) + (x2-73)^2/(20^2)) + (x3+8)^2/(0.5^2);

%g_x0 = (x1-(p*1.25+(1-p)*1.38))^2/(0.3^2) + (x2-60)^2/(10^2)) + (x3+8)^2/(0.5^2); % = 1
%g_x0 = 3*(x1-1)^2+0.0003*(x2-80)^2+1*x3^2-0.3;
%ezcontour(subs(g_x0,x3,0)+100,[0,3,0,120])
%return

%0.3^2, 10^2,0.1^2
%Ratios like 2, 100,0.5 (but depends on where centre is)

%Unsafe Space - Define it as a thin rectangle for numerical reasons?
g_xu_1_1 = (x1 - lambda_r)*(x1 - (lambda_r + 0.2)); % <0
g_xu_1_2 = (x2 - (90 - -0))*(x2 - (90-40)); % <0 %Between -20 and 95 pitch
g_xu_1_3 = (x3 - -15)*(x3 - 5); % <0  (x3 between -10 and 10?)

%Unsafe Ellipse? (/warped sphere)

%g_xu_1 = (x1-lambda_r-0.1)^2/(0.1^2) + (x2-70)^2/(100^2) + (x3)^2/(10^2) - 1;

% State space limits?
x1_lim = (x1 - 0.5)*(x1 - 2.1); % <0 (x1 between 0 and 3)
x2_lim = (x2 - (90- 0))*(x2 -(90-40)); % <0 (x2 between -5 and 100) (pitch from -15 to 100)
x3_lim = (x3 - -15)*(x3 - 5); % <0  (x3 between -10 and 10?)

g_xD = (xv_wind - 25)*(xv_wind - 35);


%Approximated C_q coefficients
C_q_Fit = 2*[-0.0240889231402065,0.00108816365174505,0.0234530529270319,-9.14549613647725e-06,-0.000613719856304388,-0.00158790611519949];

v_w_eff = xv_wind;

Pitch = 90 - x2;
% 
%F_aero = 0.5*rho*A*(C_t_Fit(1)*v_w_eff^2 + C_t_Fit(2).*Pitch*v_w_eff^2 + C_t_Fit(3).*(R*x1*v_w_eff) + C_t_Fit(4).*Pitch.^2*v_w_eff^2 +C_t_Fit(5).*Pitch.*(R*x1*v_w_eff) + C_t_Fit(6).*R*x1);
Tau_aero = 0.5*rho*A*R*(C_q_Fit(1)*v_w_eff^2 + C_q_Fit(2).*Pitch*v_w_eff^2 + C_q_Fit(3).*(R*x1*v_w_eff) + C_q_Fit(4).*Pitch.^2*v_w_eff^2 +C_q_Fit(5).*Pitch.*(R*x1*v_w_eff) + C_q_Fit(6).*(R*x1).^2);
% 
f = [(1/J_r)*(Tau_aero - B_r*x1) ;
     x3;
    -0.289*x3 - 0.0289*x2];
%f is now order 4!!!


%Create Barrier Function B, and sigma_1 and sigma_2
[prog, B] = sospolyvar(prog,VEC_2);

[prog,sig_0] = sossosvar(prog,VEC_1);
[prog,sig_1] = sossosvar(prog,VEC_1); %forms like x'Qx so order is double VEC
[prog,sig_2] = sossosvar(prog,VEC_1);
[prog,sig_3] = sossosvar(prog,VEC_1);
[prog,sig_4] = sossosvar(prog,VEC_1);%
[prog,sig_5] = sossosvar(prog,VEC_1);%
[prog,sig_6] = sossosvar(prog,VEC_1);%
[prog,sig_7] = sossosvar(prog,VEC_1);%
[prog,sig_8] = sossosvar(prog,VEC_1);
[prog,sig_9] = sossosvar(prog,VEC_1);
[prog,sig_10] = sossosvar(prog,VEC_1);

%Constrain so B is positive/negative in respective regions and gradB is negative 
% Inequalities are >= 0 
prog = sosineq(prog,-B + sig_0*g_x0 + sig_8*g_xD);
%                    4            2? +  2
%Square Unsafe Region
prog = sosineq(prog, B + sig_1*g_xu_1_1 + sig_2*g_xu_1_2 + sig_3*g_xu_1_3 + sig_9*g_xD);
%sig_1*g_xu_1_1 + sig_2*g_xu_1_2 + sig_3*g_xu_1_3 + sig_4*g_xu_1_4

%Ellipse Unsafe Region
%prog = sosineq(prog, B -0.1 + sig_1*g_xu_1);
% prog = sosineq(prog,-(v_dot - - 0.5)*(v_dot - 0.5));
% prog = sosineq(prog,-g_xD);

prog = sosineq(prog, - (diff(B,x1)*f(1) + diff(B,x2)*f(2) + diff(B,x3)*f(3)) + sig_7*g_xD + sig_4*x1_lim + sig_5*x2_lim + sig_6*x3_lim);
%                            4-1 +  4? = 7?              %other bit = sig+2
% %Define Objective Function

%prog = sossetobj(prog,-q1); %Minimise Tr(Q) = q1 + q2
%coeff_1+coeff_3*100
%
%Solve!! (solver already called at top)
prog = sossolve(prog,options);

%Get Solution!
SOLV = sosgetsol(prog,B);
g_x = sosgetsol(prog,g_x0);
%r_opt = sosgetsol(prog,r)
sig_1 = sosgetsol(prog,sig_1);
%sig_2 = sosgetsol(prog,sig_2)
f = sosgetsol(prog,f);
SOLV = p2s(SOLV);
g_x = p2s(g_x);
sig_1 = p2s(sig_1);
f = p2s(f);


%% Barrier Function Plot 1
B = matlabFunction(SOLV);

xx1 = -2:0.05:3;
xx2 = -150:3:150;
xx3 = -10:0.2:10;
[x1,x2] = meshgrid(xx1,xx2);

figure
mesh(x1,x2,B(x1,90-x2,-8,v_wind/1.4))
hold on


M = min(B(x1,90-x2,-8,v_wind/1.4),[],'all','linear');
[M_x,M_y] = find(B(x1,90-x2,-8,v_wind/1.4) == M);

x1_max = xx1(M_y);
x2_max = 90-xx2(M_x);

lengt = 101;
CO(:,:,1) = ones(lengt); % red
CO(:,:,2) = zeros(lengt); % green
CO(:,:,3) = zeros(lengt); % blue
mesh(zeros(lengt)+2.025,90-x2,x1*10,CO)
hold on
CO(:,:,1) = zeros(lengt); % red
CO(:,:,2) = ones(lengt); % green
CO(:,:,3) = zeros(lengt); % blue
mesh(x1,90-x2,zeros(lengt)+0.1,CO)

xlim([-3 3])
ylim([-20 100])
zlim([-20  200])

xlabel('Rotor Angular Velocity (rad/s)')
ylabel('Initial Pitch (Degrees)')
zlabel('Barrier Function')
title('Simplest Drive Train Subsystem Barrier Function')

